import React from 'react'
import { useParams } from 'react-router-dom';


const Info = () => {
  const { login } = useParams();
  // the rest of your logic
  const userInfo = fetch('https://api.github.com/users')
  .then(response => {
      return response.json();
  })
  .then(data => {
      this.setState({
          users : data
      })
  })
    


  return null;
}

export default Info
